import React from 'react';
import Bot from './Bot';

const YourBotArmy = ({ enlistedBots, onDelete }) => {
  // Check if enlistedBots exists and if it is an array before mapping over it
  if (!enlistedBots || !Array.isArray(enlistedBots)) {
    // Handle the case when enlistedBots is not an array or is not available
    return (
      <div className="your-bot-army">
        <h2>Your Bot Army</h2>
        <p>No bots enlisted yet.</p>
      </div>
    );
  }

  return (
    <div className="your-bot-army">
      <h2>Your Bot Army</h2>
      {enlistedBots.map((bot) => (
        <Bot key={bot.id} bot={bot} onDelete={onDelete} />
      ))}
    </div>
  );
};

export default YourBotArmy;
